export const getData = async () =>{
    const reqOps = {
        method: 'GET',            
        headers: { 'Content-Type': 'application/json' }
    };

    const response = await fetch(`http://localhost:5000`, reqOps)
    .catch(() => {return { msg:"No se pudo realizar la consulta al servidor.", status: false}});

    const datos = await response.json()
    return datos
}
